import React from 'react';
import Wordcloud from './images/wordcloud.png';

function About() {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>About</h1>
    </div>
  );
}

export default About;
